import React from 'react';
import { Container, Typography } from '@mui/material';

const HomePage = () => {
  return (
    <Container maxWidth="xl" style={{ backgroundColor: '#000', color: '#fff', minHeight: '100vh' }}>
      <Typography variant="h2" component="h1" gutterBottom>
        Anthony Mercadante
      </Typography>
      <Typography variant="body1">
        I'm a full-stack software developer. Here you can find my portfolio, 
        a small glipse of recently worked on projects using various programing languages.
      </Typography>
      {/* Additional content goes here */}
    </Container>
  );
};

export default HomePage;
